        "mantananiIsland":
            MessageLookupByLibrary.simpleMessage("Île de Mantanani"),
        "mantananiIslandContent": MessageLookupByLibrary.simpleMessage(
            "Près de Kota Belud, à Sabah, l\'île de Mantanani offre certains des meilleurs sites de plongée de Bornéo. Les snorkelers et plongeurs affluent pour nager avec des hippocampes et des raies lors d\'excursions d\'une journée depuis la capitale. Les plongeurs certifiés peuvent plonger dans plus de 20 lieux, y compris trois épaves de navires. Après quelques heures dans la mer de Chine méridionale, détendez-vous et profitez du célèbre coucher de soleil de Bornéo sur les plages de sable blanc immaculé."),
