        "miles_hotel": MessageLookupByLibrary.simpleMessage("Hôtel 1000 Miles"),
        "mossyForest": MessageLookupByLibrary.simpleMessage(
            "Forêt Moussue, Cameron Highlands"),
        "mossyForestContent": MessageLookupByLibrary.simpleMessage(
            "La Forêt Moussue est un écosystème naturel qui ne se développe qu\'aux altitudes élevées des Cameron Highlands et d\'autres chaînes montagneuses de Malaisie. Des nuages bas, poussés par le vent, enveloppent les arbres dans une brume et une humidité persistantes, offrant un biotope parfait pour les mousses, les fougères, les lichens et les orchidées. Cette forêt tropicale humide sert également de refuge à une grande diversité d\'espèces montagnardes, comme les papillons, les rongeurs, les grenouilles, les oiseaux et les mammifères qui ne se trouvent que dans ce climat froid."),
        "mountPulai": MessageLookupByLibrary.simpleMessage("Mont Pulai, Johor"),
        "mountPulaiContent": MessageLookupByLibrary.simpleMessage(
            "Le Mont Pulai est une montagne de 654 mètres dans l\'état de Johor, en Malaisie péninsulaire. En raison de sa proximité et de son accès facile, c\'est une destination populaire de randonnée pour les Singapouriens et les locaux. Le sommet du Mont Pulai n\'est pas ouvert au public car il est sécurisé par l\'armée et abrite deux tours de communication. Le Mont Pulai est un sentier de boucle modérément fréquenté de 14,3 kilomètres près de Kulai, Johor, avec une cascade et un niveau de difficulté. Le sentier est également utilisé pour le camping, le cyclisme, la course et les promenades en pleine nature."),
        "mrtDescription": MessageLookupByLibrary.simpleMessage(
            "Le Système de transport rapide (MRT) est divisé en deux lignes ; la première est la ligne Sungai Buloh-Kajang de 51 km de long avec 31 stations le long de son parcours. Toutes les stations commencent à fonctionner à 6h00 chaque jour. Les heures de fermeture varient selon les stations. Un trajet unique coûte à partir de RM1.20. Ligne d assistance : 1800-82-6868"),
