        "nasiLemakDescription": MessageLookupByLibrary.simpleMessage(
            "Le Nasi Lemak est un riz parfumé traditionnellement cuit dans du lait de coco et des feuilles de pandan, servi avec du sambal épicé, des concombres, des anchois frits, un œuf et des cacahuètes grillées. Il est préférable de l\'accompagner d un verre de teh tarik bien chaud. La plupart des magasins ou stands offrent également des options supplémentaires telles que du rendang de poulet ou de bœuf, du poulet frit, du sambal aux crevettes et bien d\'autres."),
        "nationalArtGallery":
            MessageLookupByLibrary.simpleMessage("Galerie nationale d art"),
