        "nationalMuseumDescription": MessageLookupByLibrary.simpleMessage(
            "Pour en savoir plus sur l histoire et la culture de la Malaisie et voir des répliques de maisons malaises, de scènes de mariage et d\'expositions de chasse. Des instruments locaux et des costumes nationaux seront également exposés. En plus des expositions permanentes du musée, il y a aussi des expositions temporaires qui tournent pendant l\'année et sont situées dans le Hall Central."),
        "next": MessageLookupByLibrary.simpleMessage("Suivant"),
        "nightLife": MessageLookupByLibrary.simpleMessage("Vie nocturne"),
        "nightMarket": MessageLookupByLibrary.simpleMessage("Marché nocturne"),
        "nightOutDescription": MessageLookupByLibrary.simpleMessage(
            "Kuala Lumpur est une ville dynamique avec une scène nocturne incroyable. Rendez-vous à Bangsar ou Changkat Bukit Bintang pour vivre la vie nocturne de KL. Ces lieux offrent une variété de bars, avec leurs propres bars à cocktails et des DJs jouant de la musique toute la nuit. Avec ses restaurants uniques, ses bars branchés, ses boîtes de nuit tendance et ses spots de karaoké, il y en a pour tous les goûts."),
