        "ourCompanyDescription": MessageLookupByLibrary.simpleMessage(
            "KL Le Guide est un guide trimestriel, publié pour la première fois en août 2007. Nous sommes un guide de voyage gratuit qui aide les voyageurs à organiser leur séjour dans la capitale de la Malaisie, Kuala Lumpur. KL Le Guide comprend des conseils de voyage, des lieux à explorer, des sites adaptés aux enfants, des hôtels, et plus encore. Avec KL Le Guide, naviguer dans la ville devient plus facile."),
