        "pangkorIsland": MessageLookupByLibrary.simpleMessage("Île de Pangkor"),
        "pangkorIslandContent": MessageLookupByLibrary.simpleMessage(
            "Découvrez l\'île de Pangkor si vous recherchez un endroit sans touristes. Située près de la côte de Perak, l\'île offre des plages désertes, une eau propre et une jungle dense surplombant le centre. Les visiteurs apprécient l\'opportunité de bronzer sous les palmiers sans âme qui vive à proximité. Visitez également le fort colonial hollandais et prenez des photos d\'un quai en bois traditionnel."),
        "panoramaHill": MessageLookupByLibrary.simpleMessage(
            "Colline Panorama, Sungai Lembing"),
        "panoramaHillContent": MessageLookupByLibrary.simpleMessage(
            "La Colline Panorama est située à Sungai Lembing, à 45 kilomètres au nord-ouest de Kuantan. D\'une hauteur de 271 mètres, il n\'y a qu\'un seul chemin jusqu\'au sommet. Commencez en bas de l\'escalier et montez progressivement. La principale caractéristique du sentier est un escalier avec des rampes ; quelques sections courtes seulement sont sans escalier. Une fois au sommet de la colline, vous pourrez voir une vue panoramique de la ville environnante. Il faut généralement entre 30 et 45 minutes pour atteindre le sommet de la Colline Panorama."),
        "parks": MessageLookupByLibrary.simpleMessage("Café"),
        "penangNationalPark": MessageLookupByLibrary.simpleMessage(
            "Parc National de Penang, Penang"),
        "penangNationalParkContent": MessageLookupByLibrary.simpleMessage(
            "Il s\'agit du plus petit parc national de Malaisie, avec une superficie de 23 kilomètres carrés, mais ses forêts bordées de plages abritent des singes à feuilles argentées, des lémuriens volants, des chats-léopards, ainsi qu\'une multitude de lézards, d\'amphibiens et de reptiles. Des activités comme les balades en forêt et les excursions en bateau vers des plages de sable doré complètent agréablement une journée. Le parc propose deux sentiers principaux : l\'un longe la côte jusqu\'à Monkey Beach, et l\'autre traverse les collines, passant par la jungle jusqu\'aux plages plus isolées, où se trouve le sanctuaire des tortues."),
        "petalingStreet": MessageLookupByLibrary.simpleMessage("Rue Petaling"),
        "petalingStreetDescription": MessageLookupByLibrary.simpleMessage(
