        "pulauLangkawi":
            MessageLookupByLibrary.simpleMessage("Île de Pulau Langkawi"),
        "pulauLangkawiContent": MessageLookupByLibrary.simpleMessage(
            "L\'île de Langkawi abrite certaines des plus belles plages de la Malaisie péninsulaire. L\'île combine des montagnes et des mangroves avec des côtes scintillantes. Faites une excursion d\'une journée à Pulau Dayang Bunting, inscrite par l\'UNESCO, nourrissez les aigles et regardez les singes nager pour se nourrir. Ou prenez votre serviette et bronzez sur Pantai Cenang avant de boire dans un bar de plage. Un autre avantage est que cette île est hors taxes, n\'hésitez pas à libérer votre passion pour le shopping !"),
        "pulauRedang":
            MessageLookupByLibrary.simpleMessage("Île de Pulau Redang"),
        "pulauRedangContent": MessageLookupByLibrary.simpleMessage(
            "L\'une des plus grandes îles de la côte est de la Malaisie, Pulau Redang est renommée pour ses eaux cristallines et ses plages de sable blanc. C\'est l\'une des neuf îles qui forment un parc marin sanctuaire, offrant aux touristes la possibilité de faire du snorkeling et de la plongée. La plage est composée d\'un sable blanc et doux. Vous pouvez voir des coraux et des poissons à quelques mètres de la plage."),
        "rapidKLBusDescription": MessageLookupByLibrary.simpleMessage(
            "Le Bus RapidKL est couramment vu à la plupart des stations de train et sert généralement de mode de transport en transit pour permettre aux passagers de rejoindre directement leur destination préférée. Chaque trajet en bus coûte jusqu\'à RM5.00 par trajet, payable en espèces exactes ou en utilisant la carte Touch n’ Go. Ligne d\'assistance : 03-7885 2585"),
