        "sevenWellsContent": MessageLookupByLibrary.simpleMessage(
            "La Cascade des Sept Puits, également connue sous le nom de Jalan Telaga Tujuh, est située à environ 20 minutes à pied du célèbre pont Langkawi Sky Bridge et est l\'une des attractions naturelles les plus époustouflantes de l\'île. La cascade dévale le mont Mat Cincang, le deuxième plus haut sommet de Langkawi, et est un lieu prisé des touristes et des habitants. La chute verticale complète fait 91 mètres de haut, mais seule une petite section est visible depuis le bas. Selon la légende, cette cascade est habitée par des fées et l\'eau a des propriétés apaisantes. La cascade a un aspect magique car elle est entourée par la nature, avec une riche flore et faune."),
