        "sipadanIslandContent": MessageLookupByLibrary.simpleMessage(
            "Une petite île près de Semporna, à Sabah, est classée parmi les meilleures régions de plongée au monde. Vous ne trouverez ni hébergement ni de nombreuses installations sur l\'île. Il est recommandé de faire une excursion durant votre voyage. Le vol de Kota Kinabalu à Semporna et une heure de bateau jusqu\'aux tortues et bancs de barracudas en valent la peine. Depuis son statut de zone protégée en 2002, moins de touristes obtiennent un permis pour visiter le sommet de calcaire."),
