        "sungaiLembing":
            MessageLookupByLibrary.simpleMessage("Sungai Lembing, Pahang"),
        "sungaiLembingContent": MessageLookupByLibrary.simpleMessage(
            "La Malaisie est dotée de nombreuses forêts tropicales qui abritent des cascades à couper le souffle. La Cascade de l\'Arc-en-Ciel se trouve à 45 kilomètres au nord-ouest de Kuantan, en Malaisie péninsulaire, dans la ville de Sungai Lembing. Chaque matin, entre 9h et 10h, le soleil frappe l\'eau au pied de la cascade, créant un magnifique arc-en-ciel. Les gens viennent de partout pour faire le trajet d\'une heure et demie jusqu\'à la cascade uniquement pour voir la beauté de la nature. La Cascade de l\'Arc-en-Ciel est une grande chute d\'eau cachée dans la forêt de Sungai Lembing, accessible en véhicule tout-terrain et randonnée."),
        "sungaiPisangContent": MessageLookupByLibrary.simpleMessage(
            "La cascade de Pisang est un sentier aller-retour de 3,1 kilomètres avec une cascade près de Gombak, Selangor, Malaisie. Il convient aux randonneurs de tous niveaux. Le sentier est ouvert toute l\'année et est souvent utilisé pour le camping, le vélo et l\'observation des oiseaux. Près du sommet de la cascade, il y a des endroits idéaux pour des pique-niques et des campements. Une randonnée de loisir qui vous oblige à traverser une cascade, préparez-vous à avoir les chaussures mouillées."),
