        "uluChepor": MessageLookupByLibrary.simpleMessage("Ulu Chepor, Perak"),
        "uluCheporContent": MessageLookupByLibrary.simpleMessage(
            "La cascade Lata Ulu Chepor se situe à seulement 10 kilomètres de la ville d\'Ipoh et est entourée de collines de forêt tropicale luxuriante. Le parc est accessible par la Route A1 vers Chemor, près du péage d\'Ipoh Utara. Cet endroit est idéal pour respirer de l\'air frais, se détendre et faire un pique-nique le week-end. Pour les visiteurs souhaitant rester plus longtemps ou participer à des événements éducatifs et récréatifs, des installations telles qu\'un camping, une salle polyvalente, une salle de prière et des toilettes sont disponibles. Le parc est bien entretenu et signalé sur la voie principale. Pour les plus audacieux, il y a même un sentier de descente."),
