            "Le climat à Kuala Lumpur est assez humide tout au long de l\'année. Toute personne voyageant à KL doit toujours être prête pour des pluies à tout moment de l\'année. Néanmoins, la meilleure période pour visiter KL est de mai à juillet ou de décembre à février. La météo peut être très chaude entre mars et avril. En raison des feux de forêt à Sumatera qui surviennent généralement entre juin et août, les particules de poussière peuvent créer une brume sur KL, ce qui en fait une période moins idéale pour visiter la ville."),
